import React from "react";
import { Routes, Route } from 'react-router-dom';
import Home from './Home'

export default function AppRoutes(){

    return(
        <div>
            <Routes>
                <Route path="/" element={<Home/>} />
                <Route path="/Profile" element={<Home/>} />
                <Route path="/" element={<Home/>} />


            </Routes>
        </div>
    )

}
